import React from "react";
import Slider from "react-slick";

function AutoPlay() {
  const settings = {
    dots: true,
    arrows: false,
    infinite: true,
    slidesToShow: 3,
    slidesToScroll: 1,
    autoplay: true,
    speed: 2000,
    autoplaySpeed: 2000,
    cssEase: "linear"
  };
  return (
      <Slider {...settings}>
        <div className="slider-item">
          <h3>1</h3>
        </div>
        <div className="slider-item">
          <h3>2</h3>
        </div>
        <div className="slider-item">
          <h3>3</h3>
        </div>
      </Slider>
  );
}

export default AutoPlay;
